import React from "react";
import { Link } from "react-router-dom";

const CourseCatalog: React.FC = () => {
  const courses = [
    { id: 1, title: "Intro to AI", desc: "Beginner friendly AI concepts." },
    { id: 2, title: "Full-Stack JS", desc: "Learn MERN from scratch." },
    { id: 3, title: "Cybersecurity Basics", desc: "Protect systems & networks." },
  ];

  return (
    <div className="page">
      <h2>Available Courses</h2>

      {courses.map((c) => (
        <div className="card" key={c.id}>
          <h3>{c.title}</h3>
          <p>{c.desc}</p>
          <Link to={`/course/${c.id}`}>View</Link>
        </div>
      ))}
    </div>
  );
};

export default CourseCatalog;
